import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Image from '../assets/face-detection.png';
// import clarifaiLogo from '../assets/clarifai-logo.png';
import './SignIn.css';

const SignIn = ({ onRouteChange, onNameSubmit }) => {
    return (
        <Row className="text-light">

            {/* <Col className="image-emoji" >
                <div>    
                    <img alt='' src={Image} style={{width: "300px"}} />
                </div>
            </Col> */}

            <Col className="form-container">
                <h1>Sign In </h1>
                <h5 className="mb-3">Welcome to Face Recognizer! Enter your name to begin.</h5>
                <Form>
                    <Form.Group controlId="formName">
                        <Form.Label>Name</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="Enter your name" 
                            onChange= {onNameSubmit}
                        />
                    </Form.Group>

                    <Button 
                        variant="primary" 
                        type="submit"
                        onClick={() => onRouteChange('home')}
                    >
                        Submit
                    </Button>

                </Form>
            </Col>
        </Row>
    )
}

export default SignIn;
